import React from "react";
import ReactDOM from "react-dom";

import "./App.css";

ReactDOM.render(
    <React.StrictMode>
      <Country />
    </React.StrictMode>,
    document.getElementById('root')
  );

class Country extends React.Component {
    render(){
        return (
            <div>
                <h1>Countries Game</h1>
            </div>
        )
    }
}

export default Country;
